SELECT oid, /* Unique object identifier */  mjd, /* Time of detection in modified julian date */  fid, /* Filter identifier */  mag, /* Difference magnitude */  e_mag, /* Difference magnitude error */  mag_corr, /* Corrected magnitude */  e_mag_corr, /* Error of the corrected magnitude */  isdiffpos /* Whether the difference is positive or negative */
FROM forced_photometry
WHERE oid = 'ZTF24aaiutyh' /* Filter by object identifier */
ORDER BY mjd;

/* Sort by date */

